const TShirtPage = () =>{

    const { name } = useParams();
    const Tshirt= tshirtList.filter((shirt) => shirt.name === name)[0];
    const { description, price, colors } = Tshirt;
    console.log(colors)
    // console.log(Object.keys(colors).length)
    // console.log(Object.keys(colors)[0])
    // console.log(Object.keys(colors)[1])
    // console.log(Object.keys(colors)[2])
    // console.log(Object.keys(colors)[3])

    const [n, setName] = useState(name)
    const [p, setPrice] = useState(price)
    const [image, setImage] = useState(colors.white.front)
    const [count, setCount] = useState(1)
    const [size, setSize] = useState("Women’s XS")

    const countRef = useRef()
    function handleCountSelect(e) {
        count

    }







    return (
        <Container>
            <h1 className={classes.title}>{name}</h1>
            <Row className={classes.row}>
                <Col className={classes.first}>
                    <img style={{ width: '100%' }} src={colors.white.front} alt={name} />
                </Col>


                <Col className={classes.second}>
                <h2 className={classes.price}>{price}</h2>
                <div className={classes.description}>
                    {description}</div>  
                <div className={classes.sideDiv}>
                    <div className={classes.sideText}>Side:</div>
                    <div className={classes.selectionDiv}>
                        <button className={classes.frontButton}><b>Front</b></button>
                        <button className={classes.backButton}><b>Back</b></button>
                    </div>

                </div>

                <div className={classes.colorDiv}>
                    <div className={classes.colorText}>Color: </div>
                    <ColorButton props={colors} ></ColorButton>
                </div>

                <div className={classes.quantityDiv}>
                     <div className={classes.quantityText}>Quantity:</div>
                     <select className={classes.selectButton1} ref={countRef} onClick={handleCountSelect}>
                        <option value="1">1</option>
                        <option value="2">2</option>
                        <option value="3">3</option>
                        <option value="4">4</option>
                        <option value="5">5</option>
                        <option value="6">6</option>
